@staticmethod
def format_interval(t):
    """
    Formats a number of seconds as a clock time, [H:]MM:SS

    Parameters
    ----------
    t  : int
        Number of seconds.
    Returns
    -------
    out  : str
        [H:]MM:SS
    """
    mins, s = divmod(int(t), 60)
    h, m = divmod(mins, 60)
    if h:
        return '{0:d}:{1:02d}:{2:02d}'.format(h, m, s)
    else:
        return '{0:02d}:{1:02d}'.format(m, s)

def __new__(cls, *args, **kwargs):
    instance = object.__new__(cls)
    if '_instances' not in cls.__dict__:
        cls._instances = WeakSet()
    cls._instances.add(instance)
    return instance

@classmethod
def _get_free_pos(cls, instance=None):
    """ Skips specified instance """
    try:
        return max((inst.pos for inst in cls._instances if inst is not instance)) + 1
    except ValueError as e:
        if 'arg is an empty sequence' in str(e):
            return 0
        raise

@classmethod
def _decr_instances(cls, instance):
    """
    Remove from list and reposition other bars
    so that newer bars won't overlap previous bars
    """
    try:
        cls._instances.remove(instance)
        for inst in cls._instances:
            if inst.pos > instance.pos:
                inst.pos -= 1
    except KeyError:
        pass

@classmethod
def write(cls, s, file=sys.stdout, end='\n'):
    """
    Print a message via tqdm (without overlap with bars)
    """
    inst_cleared = []
    for inst in cls._instances:
        if inst.fp == file or (file in [sys.stdout, sys.stderr] and inst.fp in [sys.stdout, sys.stderr]):
            inst.clear()
            inst_cleared.append(inst)
    file.write(s)
    file.write(end)
    for inst in inst_cleared:
        inst.refresh()

def __exit__(self, *exc):
    self.close()
    return False

def close(self):
    """
    Cleanup and (if leave=False) close the progressbar.
    """
    if self.disable:
        return
    self.disable = True
    pos = self.pos
    self._decr_instances(self)
    if not hasattr(self, 'sp'):
        return

    def fp_write(s):
        self.fp.write(_unicode(s))
    try:
        fp_write('')
    except ValueError as e:
        if 'closed' in str(e):
            return
        raise
    if pos:
        self.moveto(pos)
    if self.leave:
        if self.last_print_n < self.n:
            cur_t = self._time()
            self.sp(self.format_meter(self.n, self.total, cur_t - self.start_t, self.dynamic_ncols(self.fp) if self.dynamic_ncols else self.ncols, self.desc, self.ascii, self.unit, self.unit_scale, None, self.bar_format))
        if pos:
            self.moveto(-pos)
        else:
            fp_write('\n')
    else:
        self.sp('')
        if pos:
            self.moveto(-pos)
        else:
            fp_write('\r')

